import styled from 'styled-components';



export const TableWrap = styled.div`

    display: flex;  
    flex-direction: column;
    border-radius: 16px;

`
export const Table = styled.table`
border-collapse: collapse;
`

export const TrHead=styled.tr`
background-color: #35586C;
border: none;
height: 40px;
color: #fff;
`
